import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 28, height: 28, viewBox: "0 0 28 28", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M20 20a1 1 0 110 2H4a1 1 0 110-2h16zm4-7a1 1 0 110 2H4a1 1 0 110-2h20zm-2-7a1 1 0 110 2H4a1 1 0 110-2h18z", fill: primaryFill }));
};
const List28Filled = wrapIcon(rawSvg({}), 'List28Filled');
export default List28Filled;
